import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import { faAppStore, faGithub, faGooglePlay } from '@fortawesome/free-brands-svg-icons';






export const contact = {
  title: "Get in touch",
  description: "Coffee Chat!  Alternatively, Please feel free to reach out directly by email at keermu8@gmail.com.",
  buttons: [
    {
      title: "Email Me",
      link: "keermu8@gmail.com",
      isPrimary: true,
    },
    // {
    //   title: "Schedule Meeting",
    //   link: "https://topmate.io/Keer",
    //   isPrimary: false,
    // },
  ]
}
export const Projects = () => {
    const projects = [
        {
          title: "Pipe",
          description: "A system work",
          icons: [
            {
              icon: faGithub,
              link: "https://github.com/Keer528/Keer528",
            },
          ]
        },
        {
          title: "Quiz",
          description: "An question  answer sysytem",
          icons: [
            {
              icon: faGithub,
              link: "https://github.com/Keer528/html-css-bs-js",
            },
          ]
        },
        {
          title: "Portfolio",
          description: "A portfolio website",
          icons: [
            {
              icon: faGithub,
              link: "https://github.com/Keer528/react-portfolio",
            },

          ]
        },
        {
          title: "Business Startup",
          description: "A portfolio website",
          imgUrl: "https://github.com/Keer528/react-portfolio",
        },
        {
          title: "Business Startup",
          description: "Design & Development",
          imgUrl: projImg2,
        },
        {
          title: "Business Startup",
          description: "Design & Development",
          imgUrl: projImg3,
        },
      ];


      return (
        <section className="project" id="projects">
            <Container>
                <Row>
                    <Col>
                        <h2>Projects</h2>
                        <p>
                          This  is my project
                        </p>
                        <Tab.Container id="project-tabs" defaultActiveKey="first">
                        <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                        <Nav.Item>
                            <Nav.Link eventKey="first">Tab One</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="second">Tab Two</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="third">
                            Tab Three
                            </Nav.Link>
                        </Nav.Item>
                        </Nav>
                        <Tab.Content>
                            <Tab.Pane eventKey="first">
                                <Row>
                                    {
                                        projects.map((project, index) => {
                                            return (
                                                <ProjectCard
                                                    Key={index}
                                                    {...project}
                                                    />
                                            )
                                        })
                                    }
                                </Row>
                            </Tab.Pane>
                            <Tab.Pane eventKey="second">Loren Ipsum</Tab.Pane>
                            <Tab.Pane eventKey="third">Loren Ipsum</Tab.Pane>
                        </Tab.Content>
                        </Tab.Container>
                    </Col>
                </Row>
            </Container>

        </section>

      )
}
